  \"Long Lake National Wildlife Refuge and Long Lake Wetland Management District:
  Annual narrative report: Calendar year 1987\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:31.478697\",\n\t\"name\": \"long-lake-national-wildlife-refuge-and-long-lake-wetland-management-district-annual-narrat-19574\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Long Lake
  NWR, Long Lake WMD, and the easement refuges outlines Refuge accomplishments during
  the 1987 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses management planning, public participation, compliance with
  environmental and cultural resource mandates, and research and investigations. Refuge
  administration is outlined; information about personnel, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wetlands,
  forests, croplands, grasslands, grazing, haying, fire management, pest control,
  water rights, and WPA easements. The wildlife section of the report discusses wildlife
  diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, fisheries resources, scientific collections,
  animal control, marking and bird banding, and disease control. The public uses of
  the Refuge described in this report include outdoor classrooms, interpretive programs,
  hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, and energy conservation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
